function detalleP1ExcelTP(){    
    $.ajax({
        type: "GET",
        dataType: "json",
        url: "ajax/examenesPracticos.php?op=detalleP1ExcelTP",
        success: function(data){  
            let tabla = "";
            $('#headTablaDetalleP1ExcelTP').show();
            if (data.length > 0) {                
                for (i = 0; i < data.length; i++) {
                    tabla += "<tr>";
                    tabla += "<td align='center'>" + data[i].respuesta  + "</td>";
                    tabla += "<td align='center'>" + data[i].espol     + "</td>";
                    tabla += "<td align='center'>" + data[i].admision   + "</td>"; 
                    tabla += "<td align='center'>" + data[i].estudiantes  + "</td>";
                    tabla += "<td align='center'>" + data[i].espol_porcentaje     + "</td>";
                    tabla += "<td align='center'>" + data[i].admision_porcentaje   + "</td>"; 
                    tabla += "<td align='center'>" + data[i].porcentaje  + "</td>";                                    
                    tabla += "</tr>";
                }
            }
            $('#tablaDetalleP1ExcelTP').dataTable().fnClearTable();
            $('#tablaDetalleP1ExcelTP').dataTable().fnDestroy();
            $("#bodyTablaDetalleP1ExcelTP").html("");
            $("#tablaDetalleP1ExcelTP").append(tabla);           
        }    
    });
}

